	// ------------------------ メインロジック ------------------------
	private static void solve() {
		int k = sc.nextInt();
		int[] A = sc.nextInt(200 * k);
		int[] B = sc.nextInt(200 * k);
		int[] C = sc.nextInt(400 * k);
		int ans = 0;
		for (int b : getBlack1()) {
			int i = b / 200, j = b % 200;
			int ik = i * k, jk = j * k;
			for (int s = ik; s < ik + k; s++) {
				for (int t = jk; t < jk + k; t++) {
					ans = (ans + ((A[s] * B[t] % MOD) * C[s + t] % MOD)) % MOD;
				}
			}
		}
		for (int b : getBlack2()) {
			int i = b / 200, j = b % 200;
			int ik = i * k, jk = j * k;
			for (int s = ik; s < ik + k; s++) {
				for (int t = jk; t < jk + k; t++) {
					ans = (ans + ((A[s] * B[t] % MOD) * C[s + t] % MOD)) % MOD;
				}
			}
		}
		out.println(ans);
	}

